import './App.css';

import { BrowserRouter, Link, Route, Routes, useNavigate } from 'react-router-dom';
import { VideoMain } from './Components/videomain';
import { UserLogin } from './Components/UserLogin';





function App() {
return(
  <div className="container-fluid"> 
<div className='bg-shade'>
  <BrowserRouter>
<header className='p-2 d-flex justify-content-between'>
<div>
  <span className='h4'>
    <Link to='/' style={{color:'red',textDecoration:'none'}}>Cinema Library</Link></span>
</div>

<div>
<span className='h4'><Link to='/userlogin' className='btn btn-light>'>UserLogin</Link></span>
<span className='h4'><Link className='btn btn-light ms-2'><span className='bi bi-person-fill'></span>Admin Dasboard</Link></span>

</div>



</header>
<Routes>
  <Route path='/' element={<VideoMain/>} />
<Route path='/userlogin' element={<UserLogin/>}/>

  </Routes>




</BrowserRouter>




</div>


    </div>

)

}

export default App;
